import React from 'react';
import Logo from '../asset/image/logo.png';
const First_Main = () => {
  return (
    <div>
      <img src={Logo} alt='logo' style={{ width: '200px' }} />
      <Text style={{ color: '#21385e' }}>MENTAL HEALTHCARE APP</Text>
    </div>
  );
};

export default First_Main;
